import React from "react";
import Tilt from "react-parallax-tilt";
import "./Logo.css";

const Logo = () => {
	return (
		<div className="ma4 mt0">
			<Tilt
				tiltMaxAngleX={40}
				tiltMaxAngleY={40}
				perspective={800}
				transitionSpeed={1500}
				scale={1.5}
				gyroscope={true}
				className="Tilt br2 shadow-2"
				style={{ height: "150px", width: "150px" }}
			>
				<h1>React Parallax Tilt ðŸ‘€</h1>
			</Tilt>
		</div>
	);
};

export default Logo;
